  false,\n\t\"url\": null,\n\t\"notes\": \"An aerial photograph is a photograph of
  the earth's surface taken with a camera mounted in an airplane. The geographic extent
  of this scanned, georectified, and mosaiced 3.5-meter pixel resolution black and
  white digital aerial photograph is approximately the Idaho Department of Water Resources
  Adminstrative Basin 47. 24 tiles acquired as part of the 1964 IDWR Adminstrative
  Basin 47 Air Photo Project are included in this mosaic. The collection includes
  some of Twin Falls county, and small sections of Gooding Jerome, and Cassia counties.
  The 1:20,000-scale black and white aerial photography used in the production of
  this mosaiced image was flown in 1964 by the Farm Service Administration.\",\n\t\"license_title\":
